import TopPageTitle from "../../../../../common/components/topPageTitle/Index";
import { BsArrowLeft } from "react-icons/bs";
import Select from "react-select";
import { BiSearch } from "react-icons/bi";
export const TotalOpenings = () => {
  const options = [
    { value: "today", label: "today" },
    { value: "tomorrow", label: "tomorrow" },
    { value: "last week", label: "last week" },
  ];
  return (
    <>
      <div className="custom_container">
        <div>
          <div className="row TotalOpenings_input_main_div">
            <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-4 col-sm-12 col-12">
              <TopPageTitle
                TitleLink={-1}
                TilelIcon={<BsArrowLeft />}
                Name="Open Jobs"
              />
            </div>
            <div className="col-xxl-7 col-xl-7 col-lg-7 col-md-4 col-sm-12 col-12">
              <div className="TotalOpenings_input_div">
                <span>
                  <BiSearch />
                </span>
                <input
                  type="email"
                  class="form-control"
                  placeholder="Search by name, email or department"
                />
              </div>
            </div>
            <div className="col-xxl-2 col-xl-2 col-lg-2 col-md-4 col-sm-12 col-12">
              <div className="dashboard_top_week_Select">
                <Select options={options} placeholder="This week" />
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
